// Function to handle zombie getting hit by a projectile
function handleZombieHit (zombie: Sprite) {
    // Decrease zombie's lives by 1
    zombieLives += -1
    // Check if zombie is out of lives
    if (zombieLives < -1) {
        // Remove zombie from the game
        zombie.destroy()
    }
}
